n    link.setAttribute('target', '_blank');\n    link.href = makeTextFile(makeCSV(sources, keys, header));\n    document.body.appendChild(link);\n\n    // wait for the link to be added to the document\n    window.requestAnimationFrame(function() {\n      var event = new MouseEvent('click');\n      link.dispatchEvent(event);\n      document.body.removeChild(link);\n    });\n    "},"id":"2921","type":"CustomJS"},{"attributes":{"label":{"value":"Candidate (1,442)"},"renderers":[{"id":"2875"}]},"id":"2877","type":"LegendItem"},{"attributes":{"axis":{"id":"2848"},"dimension":1,"grid_line_width":2.5,"ticker":null},"id":"2851","type":"Grid"},{"attributes":{},"id":"2853","type":"WheelZoomTool"},{"attributes":{"fill_alpha":{"value":0.07},"fill_color":{"value":"#aa3377"},"line_alpha":{"value":0.07},"line_color":{"value":"#aa3377"},"marker":{"value":"triangle"},"size":{"units":"screen","value":8},"x":{"field":"insolation"},"y":{"field":"met"}},"id":"2889","type":"Scatter"},{"attributes":{"axis":{"id":"2844"},"grid_line_width":2.5,"ticker":null},"id":"2847","type":"Grid"},{"attributes":{"args":{"alphas":[0.4,0.4,0.8],"glyphs":[{"id":"2875"},{"id":"2883"},{"id":"2891"}],"legends":[{"id":"2877"},{"id":"2885"},{"id":"2893"}]},"code":"\nconst nglyphs = glyphs.length;\nvar some = 0;\nfor (let nn = 0; nn &lt; nglyphs; nn++) {\n    var glyph = glyphs[nn];\n    var source = glyph.data_source;\n    var legend = legends[nn];\n    \n    if (!glyph.visible){\n        source.selected.indices = [];\n    }\n\n    if (source.selected.indices.length == 0){\n        glyph.glyph.line_alpha = glyph.nonselection_glyph.line_alpha;\n        glyph.glyph.fill_alpha = glyph.nonselection_glyph.fill_alpha;\n        glyph.change.emit();\n    }\n    else {\n        glyph.glyph.line_alpha = alphas[nn];\n        glyph.glyph.fill_alpha = alphas[nn];\n        glyph.change.emit();\n        some = 1;\n    }\n    var newnum = source.selected.indices.length.toLocaleString('en-US');\n    newnum = '(' + newnum + ')';
